pragma solidity ^0.4.4;
contract PublicRegister {

    struct Entry {
		bytes32 hash;
        address issuer;
		address owner;
    }

    mapping(uint => Entry) entries;
	bytes32 public test_hash;
	bytes32 public test_hash2;


    function add(uint8 key, bytes32 hash) public returns (bool) {
		test_hash = hash;
		if (entries[key].hash == '') {
			entries[key].hash = hash;
			entries[key].owner = msg.sender;
			entries[key].issuer = msg.sender;
		}
		else {
			require (entries[key].owner == msg.sender);
			entries[key].hash = hash;
		}
    }
}
